function decodeA(code){
  var length=code.length;

  //1) Algorithm marker
  var index=1;

  //2) Width
  var w=0;
  var ch=code.charAt(index++);
  var num=parseInt(ch);
  while(!isNaN(num)){
    w *= 10;
    w += num;
    ch=code.charAt(index++);
    num=parseInt(ch);
  }

  //3) Height
  var h=0;
  ch=code.charAt(index++);
  num=parseInt(ch);
  while(!isNaN(num)){
    h *= 10;
    h += num;
    ch=code.charAt(index++);
    num=parseInt(ch);
  }

  var chars = new String();

  while(index<length)
  {
    ch = code.charAt(index++);

    if (ch != '%')
        chars += ch;
    else
    {
      ch=code.charAt(index++);
      if (ch=='%')
        chars += '%';
      else if (ch=='0')
        chars += "\r\n";
      else
      {
        //how many characters?
        var count=Number(ch);
        ch=code.charAt(index++);
        num=parseInt(ch);
        while(!isNaN(num))
        {
          count = count * 10;
          count = count + num;
          ch=code.charAt(index++);
          num=parseInt(ch);
        }

        if (ch=='%')
          ch=code.charAt(index++);

        //count times ch
        for (var i=0;i<count;++i)
          chars += ch;
      }
    }
  }

  return chars;
}

function decodeB(code){
  var length=code.length;

  //1) Algorithm marker
  var index=1;

  //2) Width
  var w=0;
  var ch=code.charAt(index++);
  var num=parseInt(ch);
  while(!isNaN(num)){
    w*=10;
    w+=num;
    ch=code.charAt(index++);
    num=parseInt(ch);
  }

  //3) Height
  var h=0;
  ch=code.charAt(index++);
  num=parseInt(ch);
  while(!isNaN(num) && index<length){
    h*=10;
    h+=num;
    ch=code.charAt(index++);
    num=parseInt(ch);
  }

  var chars = new String();

  var i=index;
  for (var y=0;y<h;++y){
    for (var x=0;x<w;++x){
      if (i>=length)
        return chars;
      else
        chars += code.charAt(i);
      ++i;
    }
    chars += "\r\n";
  }

  return chars;
}

  var y = 0;
  ch=code.charAt(index++);
  num=parseInt(ch);
  while(!isNaN(num)){
    y *= 10;
    y += num;
    ch=code.charAt(index++);
    num=parseInt(ch);
  }

  var x = 0;
  if (ch == '%'){
    ch=code.charAt(index++);
    num=parseInt(ch);
    while(!isNaN(num)){
      x *= 10;
      x += num;
      ch=code.charAt(index++);
      num=parseInt(ch);
    }
  }

  if (y >= a.length)
    a[y] = "";

  if (a[y].length < x)
    for (i = a[y].length; i < x; i++)
      a[y] += " ";

  s = code.slice(index);
  a[y] = a[y].substr(0, x) + s + a[y].slice(x + s.length);

  return a.join("\r\n");
}

function decode(code){
  if (code.length<4)
    return preFrame;

  var algorithm = code.charAt(0);
  switch (algorithm){
    case 'A':
      preFrame = decodeA(code);
      break;
    case 'B':
      preFrame = decodeB(code);
      break;
    case 'D':
      preFrame = decodeD(code);
      break;
    default:
      return "ERROR";
  }

  return preFrame;
}

lastMS=0;
MSsum=0;

function Play(){
  ms = Delay[No];
  if (ms==0)
    ms=lastMS;
  lastMS=ms;

  if (go){
    document.f.ta.value = decode(frames[No]);
    if (No < frames.length - 1){
      No++;
      MSsum += ms;
    }else{
      No = 0;
      MSsum = 0;
      if (!isLoop()){
        go=false;
      }
    }    updateProgress();
  }

  setTimeout("Play()", ms);
}

function isLoop() {
  if (!document.f.loop){
    return true;
  }
  return document.f.loop.checked;
}

function updateProgress(){
if (!document.f.progress){
  return;
}
    p = Math.floor(20 * MSsum / MStotal);
    s = "";
    for (i = 0; i < 20; i++)
      s += i == p ? ">" : "-";
    document.f.progress.value = s;
}

function performTogglePlay()
{
  go=!go;
}

function performPlay()
{
  if (go){
    No = 0;
    MSsum = 0;
  }
  go=true;
}
